import React, { Component } from "react";
import http from "./httpService";
import { Link } from "react-router-dom";
class Emps extends Component {
state = {
    emp: [],
  };
  async fetchData() {
    let response = await http.get("/svr/employees");
    let { data } = response;
    console.log(data);
    this.setState({ emp: data });
  }
  componentDidMount() {
    this.fetchData();
  }

  componentDidUpdate(prevProps, prevState) {
    if (prevProps !== this.props) this.fetchData();
  }
  render() {
    const { emp} = this.state;
    return (
      <div className="container">
          <div className="col-9">
        <div className="row bg-info">
          <div className="col-1">Id</div>
          <div className="col-1">EmpCode</div>
          <div className="col-2">Name</div>
          <div className="col-2">Department</div>
          <div className="col-2">Designation</div>
          <div className="col-2">Salary</div>
          <div className="col-2">Gender</div>
        </div>
        {emp.map((e) => (
          <div className="row" key={e.id}>
            <div className="col-1">{e.id}</div>
           <div className="col-1">{e.empCode}</div>
           <div className="col-2">{e.name}</div>
           <div className="col-2">{e.department}</div>
           <div className="col-2">{e.designation}</div>
           <div className="col-2">{e.salary}</div>
           <div className="col-2">{e.gender}</div>
          </div>
        ))}
        </div>
      </div>
    );
  }
}
export default Emps;
